import React from 'react';

function* fetchData(){
    const uri = 'https://jsonplaceholder.typicode.com/posts/1';
    const response = yield fetch(uri);
    const post = yield response.json();
    console.log(post);
}
const GeneratorExamples = ()=> {
    let f = fetchData();
    f.then(val=>console.log(val)); 
    
    return (
        <div>
            Gnerator examples
        </div>
    )
};
export default GeneratorExamples;
